            <img onClick = {navigate("/")} src= "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQJYctcCNdEo8tPvMXckYVI7kehiKtMd6sBRQ&usqp=CAU" />


        </div>
        <div className = "nav-name">
        <h1>Freaqy</h1>
        </div>
        <div onClick = {navigate("/courses")}className = "nav-courses">
            {/* navigate(/Courses) */}
            Courses
